window.bookSummaryJSON = "<p>This audiobook box set includes the first three books of the <i>Dirty Blood</i> series, a enemies-to-lovers dark fantasy romance.</p> <p><b>Book 1, </b><b><i>Bite the Woman that Feeds</i></b><b>:</b><br> <b><i>Kingsnake only wanted my blood—but now, he wants all of me.</i></b><br> Human and vampire go from enemies to lovers and unlikely allies in this first installment of a dark-fantasy-romance series featuring plenty of spice.</p> <p><b>Book 2, </b><b><i>Bite the Terror that Feeds</i></b><b>:</b><br> <b><i>He gave me his word—and he broke it.</i></b><br> In this dark fantasy romance, the second in the Dirty Blood series, Larisa finds herself torn between her pride and her jealousy in the wake of Kingsnake's betrayal.</p> <p><b>Book 3, </b><b><i>Bite the Power that Feeds</i></b><b>:</b><br> <b><i>Ellasara came at me with a blade—and she defeated me.</i></b><br> After Kingsnake makes me a nightwalker, it's hard to be in the same room with him. But I have to work with him if we're going to form an alliance with The Ethereal.</p>"; 
